    public IList<int> FindSubstring(string s, string[] words)
    {
        int substringLength = words[0].Length;
        int length = s.Length;
        int outerLength = length - (substringLength * words.Length);
        int innerLength = length - substringLength;

        List<int> result = new List<int>();

        for (int j = 0; j <= outerLength; j = j+1)
        {
            List<string> tempWordList = new List<string>(words);

            for (int i = j; i <= innerLength; i = i + substringLength)
            {
                string subString = s.Substring(i, substringLength);
                if (tempWordList.Contains(subString))
                {
                    tempWordList.Remove(subString);
                }
                else
                {
                    break;
                }
                if(tempWordList.Count == 0)
                {
                    result.Add(j);
                    break;
                }
            }
        }
            
        return result;
    }

